import React, { Component } from 'react'
//import Banner from 'react-banner'
import './banner.css'
import './markets';
import  './markets'
class Banner extends Component {
  handleClick = (event) => {

      console.log('vista Markets')

    }

  render(){
    return(
      <div className="banner">
        <img
        className="img"
        src="./images/GrafiTTraders.png"
        alt=""
        />
        <h2 className="logo">GrafiTTraders</h2>

        <div className="banner-bottom" onClick={this.props.Markets}>
          <p>Markets</p>
        </div>
        <div className="banner-bottom">
          <p>Grafits</p>
        </div>
        <div className="banner-bottom">
          <p>Suport</p>
        </div>
      </div>
    )
  }
}
export default Banner;
